import React, { Component } from 'react';
import { Button, Form, Grid, Header, Segment, Message, Icon } from 'semantic-ui-react';
import { Router } from '../routes';
import web3 from "../Ethereum/web3";
import Election_Factory from "../Ethereum/election_factory";
import Cookies from 'js-cookie';
import { Helmet } from 'react-helmet';

class CompanyLogin extends Component {
  state = {
    showSignIn: true,
    email: '',
    loading: false,
    error: null,
    showPassword: false
  };

  togglePasswordVisibility = (e) => {
    e.preventDefault();
    this.setState(prevState => ({
      showPassword: !prevState.showPassword
    }));
  };

  // ... keep all your existing signup and signin methods ...

  render() {
    const { showSignIn, loading, error, showPassword } = this.state;

    return (
      <div style={styles.container}>
        <Helmet>
          <title>Company Login</title>
          <link rel="stylesheet" href="//cdn.jsdelivr.net/npm/semantic-ui@2.4.2/dist/semantic.min.css" />
          <link rel="shortcut icon" type="image/x-icon" href="../../static/logo3.png" />
        </Helmet>

        {/* Background elements */}
        <div style={styles.background}></div>
        <div style={styles.overlay}></div>

        <Grid textAlign="center" verticalAlign="middle" style={styles.grid}>
          <Grid.Column style={styles.column}>
            <Header as="h2" style={styles.header}>
              Company Portal
            </Header>

            <div style={styles.toggleContainer}>
              <Button.Group fluid>
                <Button
                  color={showSignIn ? 'blue' : null}
                  basic={!showSignIn}
                  onClick={() => this.setState({ showSignIn: true, error: null })}
                  style={showSignIn ? styles.activeTab : styles.inactiveTab}
                >
                  Sign In
                </Button>
                <Button
                  color={!showSignIn ? 'blue' : null}
                  basic={showSignIn}
                  onClick={() => this.setState({ showSignIn: false, error: null })}
                  style={!showSignIn ? styles.activeTab : styles.inactiveTab}
                >
                  Sign Up
                </Button>
              </Button.Group>
            </div>

            <Segment stacked style={styles.segment}>
              {error && (
                <Message negative style={styles.message}>
                  {error}
                </Message>
              )}

              <div style={{
                display: showSignIn ? 'block' : 'none',
                transition: 'opacity 0.3s ease',
                opacity: showSignIn ? 1 : 0
              }}>
                <Form size="large" onSubmit={this.signin}>
                  <Form.Input
                    fluid
                    id="signin_email"
                    icon="user"
                    iconPosition="left"
                    placeholder="Email"
                    required
                    style={styles.input}
                  />
                  <Form.Input
                    fluid
                    id="signin_password"
                    icon={<Icon name='lock' />}
                    iconPosition="left"
                    placeholder="Password"
                    type={showPassword ? 'text' : 'password'}
                    required
                    style={styles.input}
                    action={{
                      icon: showPassword ? 'eye slash' : 'eye',
                      onClick: this.togglePasswordVisibility,
                      style: styles.eyeAction
                    }}
                  />
                  <Button
                    color="blue"
                    fluid
                    size="large"
                    loading={loading}
                    disabled={loading}
                    style={styles.button}
                  >
                    Sign In
                  </Button>
                </Form>
              </div>

              <div style={{
                display: showSignIn ? 'none' : 'block',
                transition: 'opacity 0.3s ease',
                opacity: showSignIn ? 0 : 1
              }}>
                <Form size="large" onSubmit={this.signup}>
                  <Form.Input
                    fluid
                    id="signup_email"
                    icon="user"
                    iconPosition="left"
                    placeholder="Email"
                    required
                    style={styles.input}
                  />
                  <Form.Input
                    fluid
                    id="signup_password"
                    icon="lock"
                    iconPosition="left"
                    placeholder="Password"
                    type="password"
                    required
                    style={styles.input}
                  />
                  <Form.Input
                    fluid
                    id="signup_repeat_password"
                    icon="lock"
                    iconPosition="left"
                    placeholder="Repeat Password"
                    type="password"
                    required
                    style={styles.input}
                  />
                  <Button
                    color="blue"
                    fluid
                    size="large"
                    style={styles.button}
                  >
                    Sign Up
                  </Button>
                </Form>
              </div>
            </Segment>
          </Grid.Column>
        </Grid>
      </div>
    );
  }
}

const styles = {
  container: {
    position: 'relative',
    minHeight: '100vh',
    width: '100%',
    overflow: 'hidden'
  },
  background: {
    position: 'fixed',
    top: 0,
    left: 0,
    width: '100vw',
    height: '100vh',
    background: 'url(/static/block.png) no-repeat center center',
    backgroundSize: 'cover',
    zIndex: -2
  },
  overlay: {
    position: 'fixed',
    top: 0,
    left: 0,
    width: '100vw',
    height: '100vh',
    backgroundColor: 'rgba(0,0,0,0.5)',
    zIndex: -1
  },
  grid: {
    height: '100vh',
    margin: 0
  },
  column: {
    maxWidth: 450,
    padding: '0 20px'
  },
  header: {
    color: 'white',
    marginBottom: '2rem',
    fontSize: '2.5rem',
    textShadow: '2px 2px 4px rgba(0,0,0,0.8)'
  },
  toggleContainer: {
    marginBottom: '2rem'
  },
  toggleButton: {
    fontSize: '1.1rem',
    padding: '1rem',
    transition: 'all 0.3s ease'
  },
  segment: {
    border: 'none',
    boxShadow: '0 5px 25px rgba(0,0,0,0.3)',
    padding: '2rem',
    background: 'rgba(255,255,255,0.95)',
    borderRadius: '10px',
    overflow: 'hidden'
  },
  button: {
    marginTop: '1.5rem',
    borderRadius: '6px',
    fontWeight: 'bold',
    fontSize: '1.1rem',
    padding: '1rem',
    backgroundColor: '#273082',
    color: 'white'
  },
  message: {
    textAlign: 'left',
    marginBottom: '1.5rem'
  },
  input: {
    marginBottom: '1.5rem'
  },
  eyeAction: {
    cursor: 'pointer',
    backgroundColor: 'transparent !important',
    boxShadow: 'none !important',
    color: '#666'
  },
  activeTab: {
    backgroundColor: '#2185d0',
    color: 'white',
    border: '1px solid #2185d0',
    fontSize: '1.1rem',
    padding: '1rem',
  },
  inactiveTab: {
    backgroundColor: 'white',
    color: 'rgba(0,0,0,.6)',
    border: '1px solid rgba(34,36,38,.15)',
    fontSize: '1.1rem',
    padding: '1rem',
    '&:hover': {
      backgroundColor: 'white !important',
      color: 'rgba(0,0,0,.6) !important',
    }
  }
};

export default CompanyLogin;
